import React from 'react';

import './card.styles.css';

export const Card = props => (
  // console.log(props),
  // console.log(props.brands),
  // console.log(props.features),
  // console.log(props.categories),
  <div className='card-container'>
    <img
      alt='item'
      src={`${props.img}`}
    />
    <h2> {props.name} </h2>
    <p> {props.description} </p>
  </div>
);
